function Wallet() {
  return (
    <ArweaveWalletKit>
      <div className="App">
        <ConnectButton
          accent="rgb(97, 7, 181)"
          profileModal={false}
          showBalance={true}
        />
      </div>
    </ArweaveWalletKit>
  );
}

export default Wallet;
